import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import "./App.css";
import NextTournament from "./components/nextTournament";
import PlayerStats from "./components/playerStats";
import "bootstrap/dist/css/bootstrap.min.css";
import Logo from "./images/logos/bull_smirk_green.png";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
import { Container } from "react-bootstrap";
import HomePage from "./components/homePage/homePage";


function App() {
  return (
    <div className="App">
       <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="/home">
            <img src={Logo} alt="Logo" />
          </Navbar.Brand>
          <Navbar.Brand href="/">StatsBull</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <NavDropdown title="Golf" id="basic-nav-dropdown">
                <NavDropdown.Item bg="light" variant="light">
                  <Link to={"/golf"} className="nav-link">
                    Tournament
                  </Link>
                </NavDropdown.Item>
                <NavDropdown.Item>
                  <Link to={"/golf/stats"} className="nav-link">
                    Player Stats
                  </Link>
                </NavDropdown.Item>
                {/* <NavDropdown.Divider /> */}
              </NavDropdown>
              {/* if i want regular items */}
              {/* <Nav.Link href="#home">Home</Nav.Link> */}
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>


      <h1>StatsBull</h1>

      <Routes>
      <Route exact path="/" element={<HomePage />} />
      <Route exact path="/home" element={<HomePage />} />
        <Route path="/golf" element={<NextTournament />} />
        <Route path="/golf/stats" element={<PlayerStats />} />
      </Routes>
    </div>
  );
}

export default App;
